import { React, useState, useEffect } from "react";
import axios from "axios";
import "./Provjere.css";
const Provjere = () => {
  const [data, setData] = useState([]);

  useEffect(async () => {
    axios
      .get(`http://localhost:5000/kategorije/get_provjere`)
      .then((res) => {
        setData(res.data);
        console.log("provjere", data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  return (
    <div>
      {data.map((item) => (
        <h1>Provjere iz kategorije: {item.naziv}</h1>
      ))}

      <ul className="kartica-provjere">
        <li className="provjera-item">{/* <h2>{item.naziv}</h2> */}</li>
        <li className="provjera-item">
          <h3>Kategorija: CSS</h3>
        </li>
        <li className="provjera-item">
          <h3>Trajanje: 10 min</h3>
        </li>
      </ul>

      <ul className="kartica-provjere">
        <li className="provjera-item">
          <h2>1. provjera iz CSS-a</h2>
        </li>
        <li className="provjera-item">
          <h3>Kategorija: CSS</h3>
        </li>
        <li className="provjera-item">
          <h3>Trajanje: 10 min</h3>
        </li>
      </ul>

      <ul className="kartica-provjere">
        <li className="provjera-item">
          <h2>1. provjera iz CSS-a</h2>
        </li>
        <li className="provjera-item">
          <h3>Kategorija: CSS</h3>
        </li>
        <li className="provjera-item">
          <h3>Trajanje: 10 min</h3>
        </li>
      </ul>

      <ul className="kartica-provjere">
        <li className="provjera-item">
          <h2>1. provjera iz CSS-a</h2>
        </li>
        <li className="provjera-item">
          <h3>Kategorija: CSS</h3>
        </li>
        <li className="provjera-item">
          <h3>Trajanje: 10 min</h3>
        </li>
      </ul>
    </div>
  );
};

